export class CubitText extends React.Component {
  static propTypes = {
    team: PropTypes.string,
    name: PropTypes.string,
  };

  render() {
    let teamColor = this.props.team === 'b' ? '#000000' : '#FFFFFF';
    let name = this.props.name;

    let parts = name.split(' ');
    if(parts.length === 2) {
      return (
        <g>
          <title>{this.props.name}</title>
          <text x="0.5" y="0.6" strokeWidth="0" textAnchor="middle" fill={teamColor}>
            <tspan x="0.5" y="0.4" fontSize="0.2">{ parts[0] }</tspan>
            <tspan x="0.5" y="0.7" fontSize="0.2">{ parts[1] }</tspan>
          </text>
        </g>
      );
    } else if(parts.length === 3) {
      return (
        <g>
          <title>{this.props.name}</title>
          <text x="0.5" y="0.6" strokeWidth="0" textAnchor="middle" fill={teamColor}>
            <tspan x="0.5" y="0.3" fontSize="0.2">{ parts[0] }</tspan>
            <tspan x="0.5" y="0.6" fontSize="0.2">{ parts[1] }</tspan>
            <tspan x="0.5" y="0.9" fontSize="0.2">{ parts[2] }</tspan>
          </text>
        </g>
      );
    } else {
      let size = (1 / name.length) * 1.5;
      return (
        <g>
          <title>{this.props.name}</title>
          <text x="0.5" y="0.6" strokeWidth="0" textAnchor="middle" fill={teamColor}>
            <tspan x="0.5" y="0.6" fontSize={size}>{ name }</tspan>
          </text>
        </g>
      );
    }
  }
}


